import SimpleButton from '../UI/SimpleButton/SimpleButton';

export default function Login() {
  return (
    <div className="auth-screen">
      <MiniBlock className="auth-screen__form">
        <MiniBlockTitle>Вход</MiniBlockTitle>
        

        <MiniBlockForm>
          <MiniBlockInput onChange={() => {}} placeholder="Логин" />
          <MiniBlockInput onChange={() => {}} placeholder="Пароль" />

          <SimpleButton type="link"></SimpleButton>
        </MiniBlockForm>
        
      </MiniBlock>
    </div>
  );
}
